import { ScrapeProvider } from './scrapeContext';

const Page = ({ children }) => {
  return (
    <ScrapeProvider value={{
      hey:'ho',
      lets:'go'
    }}>
      <div className="page">
        {children}
      </div>
    </ScrapeProvider>
  );
}

export default Page;
